import React from "react";

export function CartIcon() {
  return (
    <svg 
      xmlns="https://raw.githubusercontent.com/shakuneko/icon/master/yh-cart.png" 
      width="32" 
      height="32" 
      viewBox="0 0 32 32"
    >
      <path fill="none" stroke="#000000" stroke-linecap="square" stroke-width="2" d="M20,4 L24,16 M12,4 L8,16 M3,12 L29,12 C28.3333333,22 26.3333333,27 23,27 C18,27 14,27 9,27 C5.66666667,27 3.66666667,22 3,12 Z"/>
    </svg>
  );
}
